import React from 'react'

function NameList() {
    const persons = [
        {
            name: 'Mom',
            id: 1
        },
        {
            name: 'Bro',
            id: 2
        },
        {
            name: 'Sis',
            id: 3
        }
    ]
    const personList = persons.map(person => <Person person={person} />)


  return (
    <div>
      {
        personList
      }
    </div>
  )
}

export default NameList
